import React from 'react';
import styled from 'styled-components';

import srcLogo from '../img/dio1.png';

const Footer = styled.footer`
background-color: #eee;
display: flex;
position: fixed;
bottom: 0;
left: 0;
justify-content: center;
align-items: center;
width: 100%;
height: 70px;
`

const FooterItem = styled.span`
font-size: 18px;
text-decoration: none;
color: #777777;
font-weight: bold;
`



/* ... */

const FooterLogo = styled.img`
    width: 150px;
    height: 50px;
    margin: 15px;
`;

export default function footer() {
  return(
      <React.Fragment>
        <Footer>
            <FooterItem><FooterLogo src={srcLogo}/></FooterItem>
        </Footer>
      </React.Fragment>

  );
}
